import { Col, Container, Row } from 'react-bootstrap';
import Card from 'react-bootstrap/Card'

function App() {
  return (
    <div className="App">
       <Container>
        <Row>
          <Col xs={12} lg={6} xl={3}>
          <Card>
          <Card.Body>
          <Form.Control size="lg" type="text" placeholder="Large text" />
          </Card.Body>
        </Card>
          </Col>
        </Row>
       </Container>

    </div>
  );
}

export default App;
